        "# print(NY_model.summary())\n",
        "# fig = sm.graphics.influence_plot(NY_model, criterion=\"cooks\")\n",
        "# fig.tight_layout(pad=1.0)\n",
        "# fig = sm.graphics.plot_partregress(\"NY_Mwh\", \"MA_Mwh\", [\"Year\"], data=conv_hydro)\n",
        "# fig.tight_layout(pad=1.0)\n",
        "\n",
        "y = New_York.to_numpy()\n",
        "x = conv_hydro.index.year.to_numpy().reshape(-1,1)\n",
        "\n",
        "for i in range(0, len(x)): \n",
        "    x[i] = int(x[i]) \n",
        "\n",
        "#using sklearn\n",
        "from sklearn.model_selection import train_test_split\n",
        "X_train, X_test, y_train, y_test = train_test_split(x, y, test_size=0.5, random_state=0)\n",
        "\n",
        "regressor = LinearRegression()\n",
        "regressor.fit(X_train, y_train)\n",
        "\n",
        "y_pred = regressor.predict(X_test)\n",
        "\n",
        "df = pd.DataFrame({'Actual': y_test, 'Predicted': y_pred})\n",
        "df\n",
        "\n",
        "from sklearn import metrics\n",
        "print('Mean of Test Values:', y_test.mean())\n",
        "print('Mean Absolute Error:', metrics.mean_absolute_error(y_test, y_pred))\n",
        "print('Mean Squared Error:', metrics.mean_squared_error(y_test, y_pred))\n",
        "print('Root Mean Squared Error:', np.sqrt(metrics.mean_squared_error(y_test, y_pred)))\n",
        "\n",
        "plt.scatter(X_test, y_test,  color='black')\n",
        "plt.ylabel(\"New York State Conventional Hydroelectric production (MWh)\")\n",
        "plt.xlabel(\"Date\")\n",
        "plt.title(\"Linear Regression for NY Hydro 2010-19\")\n",
        "plt.plot(X_test, y_pred, color='blue', linewidth=3)\n",
        "\n",
        "plt.show()\n"
